import React from 'react';

const UserProfileForm = () => {
    return (
        <div className="UserProfileForm">
            <h1> Your Profile </h1>
            <form>
                <label>Username</label>
                <input type="text" disabled="true"></input>
            </form>
        </div>
    )
}

export default UserProfileForm;
